import React from 'react';
import PropTypes from 'prop-types';
import Link from 'next/link';
import { Menu } from 'antd';
import Image from 'next-images';
import Logo from '../images/PocketVaccineLogo.png';

const AppLayout = ({ children }) => {
    return(
        <div>
            <Image src={ Logo } alt="Logo" width={1000} height={300} />
            <Menu mode="horizontal">
                <Menu.Item>
                    <Link href="/"><a>커뮤니티</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/vaccinegraph"><a>살펴보기</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/vaccinestatus"><a>접종현황</a></Link>
                </Menu.Item>
                <Menu.Item>
                    <Link href="/mypage"><a>마이</a></Link>
                </Menu.Item>
            </Menu>
            {children}
        </div>
    );
}

AppLayout.proTypes = {
    children : PropTypes.node.isRequired,
}

export default AppLayout;
